script: |
  super -f text -I q5367.spq | sort > q5367.out

inputs:
  - name: q5367.spq
    data: |
      SELECT DISTINCT + col2 * ( - 90 ), + col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 + - + col1 / - - col2 * col2 NOT IN ( + col0, - col1, - col2 * + ( - + col1 ) * - col2 );
  - name: tab1

outputs:
  - name: q5367.out
    data: |
      -5310	5
      -6120	47
      -8640	14
